const CourseList = ({ courses }) => {
  console.log(courses);
  return (
    <div className='course-list'>
      {courses.map((course) => (
        <div
          className='blog-prev p-2.5 mt-5 border border-gray-500 text-gray-900'
          key={course.id}
        >
          <h2>{course.mn_name}</h2>
          <p>{course.Зорилго}</p>
        </div>
      ))}
    </div>
  );
};

export default CourseList;
